import style from './Header.module.scss';

const Header = (props: any): JSX.Element => {
  console.log(props);
  const color: string = props.fields.color.value;

  return (
    <div className={style.wrapHeader} style={{ backgroundColor: color }}>

    </div>
  );
};

export default Header;
